script: |
  super -f text -I q350.sql | sort > q350.out

inputs:
  - name: q350.sql
    data: |
      SELECT DISTINCT 94 col1, col0 / - CAST ( + 42 AS INTEGER ) + - 72 * + - col2 + - + col2 AS col2 FROM tab2 AS cor0;
  - name: tab2

outputs:
  - name: q350.out
    data: |
      94	1632
      94	2839
      94	4117
